    <Container>
      <Row>
      <Producto
      titulo="Girasol"
      imagen="\assets\descarga.jfif"
      precio="$400.000"
      descripcion="Girasol"
      />
      <Producto
      titulo="Gerbera"
      imagen="\assets\images.jfif"
      precio="$30.000"
      descripcion="género de plantas ornamentales originaria de África del Sur"
      />
      </Row>

    </Container>
  );
}

export default App;
